import React from "react";
import style from "./Card.module.css";

function Card() {
  return (
    <div>
      <div className={style.card} style={{ backgroundColor: props.color }}>
        <h2 className={style.cardText}> Day 1 </h2>
      </div>
    </div>
  );
}

export default Card;
